query ListGroups(
  $filter: ModelGroupFilterInput
  $limit: Int
  $nextToken: String
) {
  listGroups(filter: $filter, limit: $limit, nextToken: $nextToken) {
    items {
      id
      name
      userGroup {
        id
        firstname
        lastname
        email
        password
        picture
        notification
        role
        rootFolder
        group
        limitedStorage
        storageSpaceUsed
        totalStorageSpace
      }
    }
    nextToken
  }
}

